import React from 'react';
import { Container, Row, Col} from "react-bootstrap";
import "../css.css";

const Main = () => {
        return (
            <Container>
                <Row className="d-flex">
            {recipe.recipes.map(recipe =>
                <RecipeItem key={recipe.id} recipe={recipe}/>)}
        </Row>
            </Container>
        );
};

export default Main;
